import React from 'react';
import { Link } from 'react-router-dom';

const pcItem = (props) => (
    <Link to={props.link}>
        <div>
            <img src={props.pic}/>
            <h3>{props.category}</h3>
        </div>
    </Link>
)

export default pcItem;
